import { Typography } from '@material-ui/core';
import React from 'react';
import Button from '@material-ui/core/Button';

export default function Contact() {

  return (
    <section>
<div className="bg-purple">What about a quick chat?</div>
<div>
<Typography>You can direclty choose a time slot in my agenda</Typography>
<Button>Schedule a meeting</Button>
    <Typography><a href="mailto:julia.turqueti@gmail.com">julia.turqueti[at]gmail.com</a></Typography>
    <Typography>+33 7 68 61 33 57</Typography>
    <Typography><a href="https://www.linkedin.com/in/julia-turqueti/">If you are more a LinkedIn person you can also InMail me!</a></Typography>
    </div>
    </section>
  );
}
